INSERT INTO `tklucde` (`FRECNMB`, `FCODEZZ`, `FKLUCOD`, `FDESCRP`, `FNOTEZZ`) VALUES
(1, 'KLU2020-00001', '01111', 'Pertanian Tanaman Jagung', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman serealia jagung.'),
(2, 'KLU2020-00002', '01112', 'Pertanian Tanaman Gandum', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman serealia gandum, seperti sorgum/cantel, gandum (wheat/oats), jelai (barley), gandum hitam (rye), jawawut (millet) dan sejenisnya.'),
(3, 'KLU2020-00003', '01113', 'Pertanian Tanaman Kedelai', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman kedelai (kacang palawija).'),
(4, 'KLU2020-00004', '01114', 'Pertanian Tanaman Kacang Tanah', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman kacang tanah (kacang palawija).'),
(5, 'KLU2020-00005', '01115', 'Pertanian Tanaman Kacang Hijau', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman kacang hijau (kacang palawija).'),
(6, 'KLU2020-00006', '01116', 'Pertanian Tanaman Kacang-Kacangan Hortikultura', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman tanaman kacang-kacangan hortikultura, seperti buncis, buncis besar, kacang panjang, kacang merah, gude, kara, kapri, kecipir, cow peas, miju-miju, lupin, kacang polong, pigeon peas dan tanaman kacang- kacangan lainnya.'),
(7, 'KLU2020-00007', '01117', 'Pertanian Tanaman Biji-Bijian Penghasil Minyak Makan', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman biji­bijian penghasil minyak makan, seperti biji wijen, biji bunga matahari dan tanaman biji-bijian penghasil minyak makan lainnya.'),
(8, 'KLU2020-00008', '01118', 'Pertanian Tanaman Biji-Bijian Penghasil Bukan Minyak Makan', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi\r\nsatu kesatuan kegiatan tanaman biji­bijian penghasil bukan minyak makan, seperti biji kapas, biji castor, biji rami, biji mustard, niger seeds, biji jarak dan tanaman\r\nbiji-bijian penghasil bukan minyak makan lainnya.'),
(9, 'KLU2020-00009', '01119', 'Pertanian Tanaman Serealia Lainnya, Kacang­Kacangan Dan Biji-Bijian Penghasil Minyak Lainnya', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman serealia lainnya bukan padi, jagung dan gandum, tanaman kacang­kacangan palawija lainnya dan pertanian tanaman lainnya yang belum diklasifikasikan pada kelompok 01111 s.d. 01118.'),
(10, 'KLU2020-00010', '01120', 'Pertanian Padi', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman padi baik padi sawah dan padi\r\nladang sampai dengan dihasilkan produk gabah kering basah (GKB). Budidaya ikan di sawah (mina padi) digolongkan dalam kegiatan perikanan.'),
(11, 'KLU2020-00011', '01131', 'Pertanian Tanaman Hortikultura Sayuran Daun', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan, dan pasca panen jika menjadi satu kesatuan kegiatan tanaman hortikultura sayuran yang dipanen sekali, seperti petsai/sawi, asparagus, kubis/kol, kembang kol dan brokoli, selada dan seledri/chicory, daun bawang, paprika, petsai/sawii, bayam, kangkung, tumbuhan yang bunganya dimakan sebagai sayur dan sayuran daun dan batang lainnya. Bayam dan kangkung yang dipanen dengan akarnya juga dimasukkan dalam kelompok ini.'),
(12, 'KLU2020-00012', '01132', 'Pertanian Tanaman Hortikultura Buah', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman hortikultura buah, seperti semangka, belewah, melon, timun suri dan sejenisnya.'),
(13, 'KLU2020-00013', '01133', 'Pertanian Tanaman Hortikultura Sayuran Buah', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman hortikultura buah yang dipakai sebagai sayuran (labu), seperti mentimun, terung, tomat, belimbing sayur dan labu sayur (siam), waluh/labu kuning, gambas/oyong dan sejenisnya.'),
(14, 'KLU2020-00014', '01134', 'Pertanian Tanaman Hortikultura Sayuran Umbi', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, pemanenan, dan pasca panen jika menjadi satu kesatuan kegiatan tanaman umbi­umbian hortikultura, seperti kentang, kentang manis, wortel, lobak cina, rebung, bawang putih, bawang bombay atau bawang merah, bawang perai dan sayuran alliaceous lainnya.'),
(15, 'KLU2020-00015', '01135', 'Pertanian Tanaman Umbi-Umbian Palawija', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi\r\nsatu kesatuan kegiatan tanaman umbi-umbian palawija, seperti ubi kayu, ubi jalar, talas, ganyong dan irut, gembili dan tanaman umbi-umbian palawija lainnya.'),
(16, 'KLU2020-00016', '01136', 'Pertanian Tanaman Jamur', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman jamur dan truffle, seperti jamur merang, jamur tiram, jamur shitake, jamur kuping dan sejenisnya.'),
(17, 'KLU2020-00017', '01137', 'Pertanian Tanaman Bit Gula Dan Tanaman Pemanis Bukan Tebu', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman bit gula dan tanaman pemanis lainnya bukan tebu, seperti stevia dan sorgum manis.'),
(18, 'KLU2020-00018', '01139', 'Pertanian Tanaman Hortikultura Sayuran Lainnya', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman hortikultura sayuran lainnya yang dipanen lebih dari sekali; pertanian bibit sayuran, kecuali bibit bit; dan pertanian sayuran lainnya.'),
(19, 'KLU2020-00019', '01140', 'Perkebunan Tebu', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan jika menjadi satu kesatuan kegiatan tanaman tebu.'),
(20, 'KLU2020-00020', '01150', 'Perkebunan Tembakau', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan jika menjadi satu kesatuan kegiatan tanaman tembakau. Termasuk pula pengolahan daun tembakau yang tak dapat dipisahkan dari kegiatan perkebunan seperti pembersihan dan perajangan tembakau yang tidak dapat dipisahkan dari kegiatan perkebunannya.'),
(21, 'KLU2020-00021', '01160', 'Pertanian Tanaman Berserat', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan jika menjadi satu kesatuan kegiatan tanaman berserat sebagai bahan baku tekstil, seperti kapuk, kapas, rosela, rami, yute, linen, agave, abaca dan kenaf, perkebunan sisal dan tanaman bahan baku tekstil lainnya termasuk genus agave dan perkebunan tanaman serat lainnya.'),
(22, 'KLU2020-00022', '01191', 'Pertanian Tanaman Rumput-Rumputan Dan Tanaman Pakan Ternak', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman rumput-rumputan semusim lainnya yang tidak termasuk dalam kelompok manapun, seperti tanaman pupuk hijau, tanaman penutup tanah dan pertanian sewede, mangold, akar-akaran untuk makanan hewan, rumput gajah, semanggi, alfalfa, saifoin, tanaman jagung (maize) dan rumput-rumputan lainnya untuk makanan ternak dan sejenisnya.'),
(23, 'KLU2020-00023', '01192', 'Pembibitan Bit (Bukan Bit Gula) Dan Bibit Tanaman Pakan Ternak', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan bit (bukan bit gula) dan bibit tanaman pakan ternak.'),
(24, 'KLU2020-00024', '01193', 'Pertanian Tanaman Bunga', 'Kelompok ini mencakup pertanian tanaman semusim yang lain, seperti pertanian tanaman bunga, termasuk produksi bunga potong dan pucuk bunga. Tanaman bunga pada kelompok ini misalnya anggrek, anyelir, gerbera/hebras, gladiol, krisan, mawar, melati, sedap malam dan tanaman bunga lainnya. Termasuk tanaman anthurium bunga, euphorbia, adenium (kamboja Jepang) dan Ixora (soka).'),
(25, 'KLU2020-00025', '01194', 'Pertanian Pembibitan Tanaman Bunga', 'Kelompok ini mencakup usaha pertanian pembibitan tanaman bunga.'),
(26, 'KLU2020-00026', '01210', 'Pertanian Buah Anggur', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan atau pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah anggur.'),
(27, 'KLU2020-00027', '01220', 'Pertanian Buah-Buahan Tropis', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan/ pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah-buahan tropis, seperti rambutan, alpukat, durian, duku, pisang dan pisang raja, kurma, buah ara, pepaya, jambu biji, jambu air, lengkeng, nangka, nenas, mangga, manggis, sawo, belimbing, salak, sirsak dan sejenisnya.'),
(28, 'KLU2020-00028', '01230', 'Pertanian Buah Jeruk', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan/ pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah jeruk besar dan jeruk keprok atau jeruk siam, seperti jeruk Bali, jeruk lemon dan limau, jeruk orange, jeruk keprok, jeruk tangerin, jeruk mandarin dan clementine dan buah jeruk lainnya.'),
(29, 'KLU2020-00029', '01240', 'Pertanian Buah Apel Dan Buah Batu (Pome And Stone Fruits)', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan/ pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah apel dan buah batu, seperti apel, aprikot, cherry, peach dan nectarine, pear dan quince, plum dan sloe, markisa, kepel, buah naga, terong Belanda dan buah delima dan buah batu lainnya.'),
(30, 'KLU2020-00030', '01251', 'Pertanian Buah Beri', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan atau pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah beri, seperti blueberry, gooseberry, kiwi, raspberry, strawberry dan beri lainnya termasuk pembibitannya.'),
(31, 'KLU2020-00031', '01252', 'Pertanian Tanaman Buah Biji Kacang-Kacangan', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman buah biji kacang?kacangan yang dapat dimakan, seperti almond, kacang mede, chestnut, kenari, walnut dan kacang-kacangan yang lainnya termasuk pembibitannya.'),
(32, 'KLU2020-00032', '01253', 'Pertanian Tanaman Sayuran Tahunan', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman sayuran tahunan, seperti kluwih atau timbul, sukun, nangka sayur, petai, jengkol, melinjo dan sejenisnya.'),
(33, 'KLU2020-00033', '01259', 'Pertanian Tanaman Buah Semak Lainnya', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman buah semak lainnya, termasuk locust beans.'),
(34, 'KLU2020-00034', '01261', 'Perkebunan Buah Kelapa', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan buah kelapa.'),
(35, 'KLU2020-00035', '01262', 'Perkebunan Buah Kelapa Sawit', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan buah kelapa sawit.'),
(36, 'KLU2020-00036', '01269', 'Perkebunan Tanaman Buah Oleaginous Lainnya', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman buah oleaginous lain, seperti buah zaitun dan lainnya.'),
(37, 'KLU2020-00037', '01270', 'Pertanian Tanaman Untuk Bahan Minuman', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman untuk bahan minuman, seperti tanaman kopi, teh, mate dan kakao.'),
(38, 'KLU2020-00038', '01281', 'Perkebunan Lada', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan lada atau merica (piper spp).'),
(39, 'KLU2020-00039', '01282', 'Perkebunan Cengkeh', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan cengkeh.'),
(40, 'KLU2020-00040', '01283', 'Perkebunan Cabe', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, pemanenan dan pasca panen sayuran cabe (capsicum spp), seperti cabe besar, cabe rawit dan paprika.'),
(41, 'KLU2020-00041', '01284', 'Perkebunan Tanaman Aromatik/Penyegar', 'Kelompok mi mencakup usaha perkebunan mulai dan kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman perkebunan minyak atsini, seperti sereh wangi, nilam, menthol, cendana, kenanga, ilang-ilang, gandapura, lawang.'),
(42, 'KLU2020-00042', '01285', 'Pertanian Tanaman Obat Atau Biofarmaka Rimpang', 'Kelompok mi mencakup usaha perkebunan mulai dan kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman obat atau biofarmaka nimpang (termasuk pula tanaman bahan insektisida dan fungisida dan yang sejenis), seperti jahe, kunyit, temulawak, temugining, temuireng, temukunci, kencur, lengkuas, lempuyang, dlingo dan sejenisnya.'),
(43, 'KLU2020-00043', '01286', 'Pertanian Tanaman Obat Atau Biofarmaka Non Rimpang', 'Kelompok mi mencakup usaha perkebunan mulai dan kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman obat atau biofarmaka non nimpang (termasuk pula tanaman bahan insektisida dan fungisida dan yang sejenis), seperti kina, adas, kapulaga, orang-aning, iles­iles, pinang, gambir, lidah buaya, kejibeling, sambioto, kumis kucing, mengkudu atau pace, mahkota dewa dan sejenisnya.'),
(44, 'KLU2020-00044', '01289', 'Pertanian Tanaman Rempah-Rempah, Aromatik/Penyegar, Narkotik Dan Obat Lainnya', 'Kelompok ini mencakup usaha perkebunan mulai dan kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman rempah lainnya, seperti kemini, panili, kayu manis dan pala.'),
(45, 'KLU2020-00045', '01291', 'Perkebunan Karet Dan Tanaman Penghasil Getah Lainnya', 'Kelompok ini mencakup usaha perkebunan mulai dan kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman karet dan tanaman penghasil getah lainnya, seperti getah perca dan kemenyan. Termasuk pengolahan hasil tanaman karet yang tidak dapat dipisahkan dan kegiatan perkebunan.'),
(46, 'KLU2020-00046', '01299', 'Perkebunan Cemara Dan Tanaman Tahunan Lainnya', 'Kelompok mi mencakup usaha perkebunan mulai dan kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan pohon cemara dan tanaman tahunan lainnya.'),
(47, 'KLU2020-00047', '01301', 'Pertanian Tanaman Hias Bukan Tanaman Bunga', 'Kelompok mi mencakup pertanian atau budidaya tanaman hias yang dipanen bukan bunganya, seperti bonsai, suplir, kupmg gajah, heliconia (pisang-pisangan), dracaena, phylodendrom, monstera, cordyline, anthunium daun, pakis, aglonema, difenbacia, sansifera (lidah mertua), caladium (keladi), palem dan tanaman hias bukan tanaman bunga lainnya. Tenmasuk penanaman tumbuhan untuk tujuan onnamen dan tanah benumput untuk transplantasi.'),
(48, 'KLU2020-00048', '01302', 'Pertanian Pengembangbiakan Tanaman Holtikultura Lainnya Bukan', 'Kelompok ini mencakup produksi semua bibit tanaman secara vegetatif termasuk batang stek, potongan dan pembibitan untuk kelangsungan pengembanganbiakan tanaman atau membuat batang okulasi tanaman pada keturunannya terpiih yang diokulasi yang pada akhirnya ditanam untuk menghasilkan tanaman. Termasuk kegiatan penanaman tumbuhan untuk ditanam kembali, penanaman tumbuhan hidup untuk umbi-umbian, akar-akaran; pemotongan, stek dan cangkokan; spawn jamur dan kebun bibit tanaman, kecuali kebun bibit tanaman hutan.'),
(49, 'KLU2020-00049', '01411', 'Pembibitan Dan Budidaya Sapi Potong', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan sapi potong, untuk menghasilkan ternak bibit sapi potong, mani dan mudigah dan peternakan yang menyelenggarakan budidaya sapi potong (termasuk kegiatan penggemukan) untuk menghasilkan sapi bakalan dan sapi potong.'),
(50, 'KLU2020-00050', '01412', 'Pembibitan Dan Budidaya Sapi Perah', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan sapi perah, untuk menghasilkan ternak bibit sapi perah, mani dan mudigah dan peternakan yang menyelenggarakan budidaya sapi perah untuk menghasilkan susu.'),
(51, 'KLU2020-00051', '01413', 'Pembibitan Dan Budidaya Kerbau Potong', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan kerbau potong, untuk menghasilkan ternak bibit kerbau potong, mani dan mudigah dan peternakan yang menyelenggarakan budidaya kerbau (termasuk kegiatan penggemukan) untuk menghasilkan kerbau bakalan dan kerbau potong.'),
(52, 'KLU2020-00052', '01414', 'Pembibitan Dan Budidaya Kerbau Perah', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan kerbau perah, untuk menghasilkan ternak bibit kerbau perah, mani dan mudigah dan peternakan yang menyelenggarakan budidaya kerbau perah untuk menghasilkan susu.'),
(53, 'KLU2020-00053', '01420', 'Peternakan Kuda Dan Sejenisnya', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan kuda, untuk menghasilkan ternak bibit kuda, mani dan mudigah dan peternakan yang menyelenggarakan budidaya kuda untuk menghasilkan kuda potong, kuda pacu dan kuda tarik.'),
(54, 'KLU2020-00054', '01430', 'Peternakan Unta Dan Sejenisnya', 'Kelompok ini mencakup pembibitan dan budidaya unta dan sejenisnya.'),
(55, 'KLU2020-00055', '01441', 'Pembibitan Dan Budidaya Domba', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan domba, yang menghasilkan ternak bibit domba, mani dan mudigah dan peternakan yang menyelenggarakan budidaya domba (termasuk kegiatan penggemukan) untuk menghasilkan domba potong dan untuk diambil bulunya.'),
(56, 'KLU2020-00056', '01442', 'Pembibitan Dan Budidaya Kambing Potong', 'Kelompok ini mencakup usaha yang menyelenggarakan pembibitan kambing potong, untuk menghasilkan ternak bibit kambing potong, mani dan mudigah dan peternakan yang menyelenggarakan budidaya kambing (termasuk kegiatan penggemukan) untuk menghasilkan kambing potong.'),
(57, 'KLU2020-00057', '01443', 'Pembibitan Dan Budidaya Kambing Perah', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan kambing perah, untuk menghasilkan ternak bibit kambing perah, mani dan mudigah dan peternakan yang menyelenggarakan budidaya kambing perah untuk menghasilkan susu.'),
(58, 'KLU2020-00058', '01450', 'Peternakan Babi', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan ternak babi, untuk menghasilkan ternak bibit babi, mani dan mudigah dan peternakan yang menyelenggarakan budidaya babi untuk menghasilkan babi potong.'),
(59, 'KLU2020-00059', '01461', 'Pembibitan Dan Budidaya Ayam Ras Pedaging', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan ayam ras pedaging untuk menghasilkan ayam bibit dan telur tetas dan peternakan yang menyelenggarakan budidaya ayam ras untuk menghasilkan ayam pedaging dan lainnya.'),
(60, 'KLU2020-00060', '01462', 'Pembibitan Dan Budidaya Ayam Ras Petelur', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan ayam ras petelur untuk menghasilkan ayam bibit dan telur tetas dan peternakan yang menyelenggarakan budidaya ayam ras untuk menghasilkan telur konsumsi dan lainnya.'),
(61, 'KLU2020-00061', '01463', 'Pembibitan Dan Budidaya Ayam Buras', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan ayam buras (bukan ras), untuk menghasilkan ternak bibit ayam buras petelur dan atau telur tetas dan peternakan yang menyelenggarakan budidaya ayam buras untuk menghasilkan ayam buras potong, telur konsumsi dan lainnya.'),
(62, 'KLU2020-00062', '01464', 'Pembibitan Dan Budidaya Itik', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan itik, untuk menghasilkan ternak bibit itik dan atau telur tetas dan peternakan yang menyelenggarakan budidaya itik untuk menghasilkan itik potong, telur konsumsi dan lainnya.'),
(63, 'KLU2020-00063', '01465', 'Pembibitan Dan Budidaya Itik Manila', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan itik manila, untuk menghasilkan ternak bibit itik manila dan atau telur tetas dan peternakan yang menyelenggarakan budidaya itik manila untuk menghasilkan itik manila potong, telur konsumsi dan lainnya.'),
(64, 'KLU2020-00064', '01466', 'Pembibitan Dan Budidaya Burung Puyuh', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan burung puyuh, untuk menghasilkan ternak bibit burung puyuh dan atau telur tetas dan peternakan yang menyelenggarakan budidaya burung puyuh untuk menghasilkan burung puyuh potong atau telur konsumsi.'),
(65, 'KLU2020-00065', '01467', 'Pembibitan Dan Budidaya Burung Merpati', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan burung merpati, untuk menghasilkan ternak bibit burung merpati dan atau telur tetas dan peternakan yang menyelenggarakan budidaya burung merpati untuk menghasilkan burung merpati potong atau diambil bulunya.'),
(66, 'KLU2020-00066', '01469', 'Pembibitan Dan Budidaya Ternak Unggas Lainnya', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan ternak unggas lainnya, seperti kalkun, entok, angsa dan burung walet, untuk menghasilkan bibit dan atau telur tetas dan peternakan yang menyelenggarakan budidaya unggas tersebut untuk menghasilkan daging, bulu dan telur.'),
(67, 'KLU2020-00067', '01491', 'Pembibitan Dan Budidaya Burung Unta', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan burung unta, untuk menghasilkan ternak bibit burung unta dan atau telur tetas dan peternakan yang menyelenggarakan budidaya burung unta konsumsi untuk menghasilkan burung unta potong, telur dan atau lainnya.'),
(68, 'KLU2020-00068', '01492', 'Pengusahaan Kokon/Kepompong Ulat Sutera', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran kokon/kepompong ulat sutera.'),
(69, 'KLU2020-00069', '01493', 'Pembibitan Dan Budidaya Lebah', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan dan budidaya lebah, termasuk pengusahaan madu.'),
(70, 'KLU2020-00070', '01494', 'Pembibitan Dan Budidaya Rusa', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan dan budidaya ternak rusa/kijang, baik untuk menghasilkan bibit dan daging, kulit dan lainnya.'),
(71, 'KLU2020-00071', '01499', 'Pembibitan Dan Budidaya Aneka Ternak Lainnya', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan aneka ternak, seperti kelinci/marmut, anjing, kucing, kera/primata lainnya, ulat, cacing, jangkrik dan aneka ternak lainnya, untuk menghasilkan bibit dan peternakan yang menyelenggarakan budidaya aneka ternak untuk menghasilkan daging, kulit dan lainnya.'),
(72, 'KLU2020-00072', '01611', 'Jasa Pengolahan Lahan', 'Kelompok ini mencakup usaha pengolahan lahan pertanian tanaman pangan dan perkebunan atas dasar balas jasa (fee) atau kontrak dengan tujuan untuk persiapan penanaman, baik di lahan sawah maupun di lahan kering.'),
(73, 'KLU2020-00073', '01612', 'Jasa Pemupukan, Penanaman Bibit/Benih Dan Pengendalian Jasad Pengganggu', 'Kelompok ini mencakup usaha yang bergerak dalam pemupukan lahan pertanian, penanaman bibit/benih dan pengendalian hama penyakit dan tanaman pengganggu tanaman pangan dan perkebunan atas dasar balas jasa (fee) atau kontrak.'),
(74, 'KLU2020-00074', '01613', 'Jasa Pemanenan', 'Kelompok ini mencakup usaha pemanenan tanaman atas dasar balas jasa (fee)\r\natau kontrak.'),
(75, 'KLU2020-00075', '01614', 'Jasa Penyemprotan Dan Penyerbukan Melalui Udara', 'Kelompok ini mencakup usaha penyemprotan dan penyerbukan melalui udara dengan pesawat udara khusus berdasarkan keadaan tertentu dengan tujuan kota- kota atau provinsi di dalam negeri.'),
(76, 'KLU2020-00076', '01619', 'Jasa Penunjang Pertanian Lainnya', 'Kelompok ini mencakup jasa penunjang pertanian lainnya yang belum termasuk dalam kelompok jasa penunjang pertanian di atas, seperti penyelenggaraan pengairan/penyiraman serta penyediaan alat pertanian berikut operatornya, pemeliharaan dan perawatan alat pertanian atas dasar balas jasa (fee) atau kontrak. Penyewaan khusus alat pertanian tanpa operatornya dimasukkan dalam\r\n77305.'),
(77, 'KLU2020-00077', '01621', 'Jasa Pelayanan Kesehatan Ternak', 'Kelompok ini mencakup usaha yang bergerak dalam bidang pelayan kesehatan/pengobatan ternak atas dasar balas jasa (fee) atau kontrak. Pelayanan kesehatan hewan dari jenis hewan bukan ternak dimasukkan dalam 75000.'),
(78, 'KLU2020-00078', '01622', 'Jasa Pemacekan Ternak', 'Kelompok ini mencakup usaha yang bergerak dalam bidang pemacekan ternak atas dasar balas jasa (fee) atau kontrak, seperti inseminasi buatan, pelayanan kuda\r\nbiak.'),
(79, 'KLU2020-00079', '01623', 'Jasa Penetasan Telur', 'Kelompok ini mencakup usaha yang bergerak dalam bidang penetasan telur atas dasar balas jasa (fee) atau kontrak.'),
(80, 'KLU2020-00080', '01629', 'Jasa Penunjang Peternakan Lainnya', 'Kelompok ini mencakup usaha yang bergerak dalam jasa penunjang peternakan lainnya atas dasar balas jasa (fee) atau kontrak, seperti pencukuran bulu ternak, pembersihan kandang ternak, termasuk juga usaha pelayanan pencari rumput, pemeliharaan dan perawatan hewan dan penggembalaan ternak.'),
(81, 'KLU2020-00081', '01630', 'Jasa Pasca Panen', 'Kelompok ini mencakup usaha pasca panen meliputi usaha penyiapan hasil panen pertanian untuk dijual, seperti pembersihan, sortasi, pengupasan, pengeringan dengan sinar matahari dan pengepakan dari macam-macam hasil pertanian atas dasar balas jasa (fee) atau kontrak. Termasuk usaha disinfektan hasil panen, pemisahan biji kapas, penyiapan daun tembakau, penyiapan biji cokelat dan pemberian lilin pada buah-buahan.'),
(82, 'KLU2020-00082', '01640', 'Pemilihan Bibit Tanaman Untuk Pengembangbiakan', 'Kelompok ini mencakup semua kegiatan pasca panen yang ditujukan untuk meningkatkan perkembangan kualitas bibit melalui pemilahan material non bibit, bibit berukuran terlalu kecil, kerusakan mekanik atau kerusakan karena serangga dan benih yang belum matang, dan juga menjaga kelembaban bibit ke kondisi aman untuk penyimpan bibit. Kegiatan ini mencakup pengeringan, pembersihan, sortasi dan lainnya sampai bibit dipasarkan. Pemeliharaan bibit yang telah dimodifikasi juga termasuk di sini.'),
(83, 'KLU2020-00083', '01701', 'Perburuan Dan Penangkapan Satwa Liar', 'Kelompok ini mencakup usaha perburuan dan penangkapan satwa liar dalam rangka pengendalian populasi dan pelestarian. Termasuk usaha pengawetan dan penyamakan kulit dari furskin, reptil, dan kulit unggas hasil perburuan dan penangkapan. Termasuk perburuan dan penangkapan binatang dengan perangkap untuk umum, penangkapan binatang (mati atau hidup) untuk makanan, bulu, kulit atau untuk penelitian, untuk ditempatkan dalam kebun binatang atau sebagai hewan peliharaan, produksi kulit bulu binatang, reptil atau kulit burung dari kegiatan perburuan atau penangkapan.'),
(84, 'KLU2020-00084', '01702', 'Penangkaran Satwa Liar', 'Kelompok ini mencakup usaha penangkaran, pembesaran, penelitian untuk pelestarian satwa liar, baik satwa liar darat dan satwa liar laut seperti mamalia laut, misalnya duyung, singa laut dan anjing laut.'),
(85, 'KLU2020-00085', '02111', 'Pengusahaan Hutan Jati', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan dan pemasaran jenis tanaman jati.'),
(86, 'KLU2020-00086', '02112', 'Pengusahaan Hutan Pinus', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan dan pemasaran jenis tanaman pinus.'),
(87, 'KLU2020-00087', '02113', 'Pengusahaan Hutan Mahoni', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan dan pemasaran jenis tanaman mahoni.'),
(88, 'KLU2020-00088', '02114', 'Pengusahaan Hutan Sonokeling', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan, dan pemasaran jenis tanaman sonokeling.'),
(89, 'KLU2020-00089', '02115', 'Pengusahaan Hutan Albasia/Jeunjing', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan dan pemasaran jenis tanaman albasia/jeunjing.'),
(90, 'KLU2020-00090', '02116', 'Pengusahaan Hutan Cendana', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan dan pemasaran jenis tanaman cendana.'),
(91, 'KLU2020-00091', '02117', 'Pengusahaan Hutan Akasia', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan dan pemasaran jenis tanaman akasia.'),
(92, 'KLU2020-00092', '02118', 'Pengusahaan Hutan Ekaliptus', 'Kelompok ini mencakup usaha persemaian, penanaman, pemeliharaan, pemanenan hasil, pengolahan dan pemasaran jenis tanaman ekaliptus.'),
(93, 'KLU2020-00093', '02119', 'Pengusahaan Hutan Lainnya', 'Kelompok ini mencakup pengusahaan kayu lainnya yang belum termasuk dalam kelompok 02111 s.d. 02118, seperti pengusahaan tanaman gmelina, jabon dan tanaman belukar.'),
(94, 'KLU2020-00094', '02120', 'Pengusahaan Hutan Alam', 'Kelompok ini mencakup usaha yang terpadu antara kegiatan pemanenan kayu dengan batas diameter, pengolahan, pemasaran, penanaman kembali serta pemeliharaan tanaman dari jenis-jenis alami, seperti meranti, kruing, pulai, ramin, kayu besi, kayu hitam, ulin dan sebagainya. Termasuk juga usaha pengangkutan kayu yang dilakukan oleh pengusaha hutan itu sendiri.'),
(95, 'KLU2020-00095', '02131', 'Pengusahaan Rotan', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran jenis tanaman rotan.'),
(96, 'KLU2020-00096', '02132', 'Pengusahaan Getah Pinus', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran getah pinus.'),
(97, 'KLU2020-00097', '02133', 'Pengusahaan Daun Kayu Putih', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran daun kayu putih.'),
(98, 'KLU2020-00098', '02134', 'Pengusahaan Bambu', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran hasil-hasil hutan bambu.'),
(99, 'KLU2020-00099', '02135', 'Pengusahaan Damar', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran damar.'),
(100, 'KLU2020-00100', '02136', 'Pengusahaan Gaharu', 'Kelompok ini mencakup usaha penanaman, pemeliharaan,pemungutan hasil, pengolahan dan pemasaran hasil hutan gaharu.'),
(101, 'KLU2020-00101', '02139', 'Pengusahaan Hutan Bukan Kayu Lainnya', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran hasil hutan bukan kayu lainnya, misalnya jernang, shellak.'),
(102, 'KLU2020-00102', '02201', 'Penebangan Kayu', 'Kelompok ini mencakup kegiatan poduksi kayu gelondongan untuk industri pengolahan dan produksi kayu gelondongan digunakan dalam bentuk yang tidak diolah, seperti pit-props, tonggak pagar dan tiang listrik atau telepon.'),
(103, 'KLU2020-00103', '02202', 'Usaha Pemungutan Kayu', 'Kelompok ini mencakup usaha pemungutan hasil kayu dengan batas diameter tertentu yang terpisah dari usaha pengusahaan kayu. Termasuk kegiatan pengumpulan dan produksi kayu bakar.'),
(104, 'KLU2020-00104', '02209', 'Usaha Kehutanan Lainnya', 'Kelompok ini mencakup usaha di bidang kehutanan yang tidak tercakup dalam kelompok manapun, seperti produksi arang di hutan dengan cara tradisional.'),
(105, 'KLU2020-00105', '02301', 'Pemungutan Getah Karet', 'Kelompok ini mencakup usaha pemungutan getah tanaman karet dan tanaman penghasil getah lainnya, seperti pemungutan getah tanaman karet hutan, getah perca, jelutung dan kemenyan.'),
(106, 'KLU2020-00106', '02302', 'Pemungutan Rotan', 'Kelompok ini mencakup usaha pemungutan hasil, pengolahan dan pemasaran jenis tanaman rotan.'),
(107, 'KLU2020-00107', '02303', 'Pemungutan Getah Pinus', 'Kelompok ini mencakup usaha pemungutan hasil, pengolahan dan pemasaran getah pinus.'),
(108, 'KLU2020-00108', '02304', 'Pemungutan Daun Kayu Putih', 'Kelompok ini mencakup usaha pemungutan hasil, pengolahan dan pemasaran daun kayu putih.'),
(109, 'KLU2020-00109', '02305', 'Pemungutan Kokon/Kepompong Ulat Sutera', 'Kelompok ini mencakup usaha pemungutan hasil, pengolahan dan pemasaran kokon/kepompong ulat sutera.'),
(110, 'KLU2020-00110', '02306', 'Pemungutan Damar', 'Kelompok ini mencakup usaha pemungutan hasil, pengolahan dan pemasaran damar.'),
(111, 'KLU2020-00111', '02307', 'Pemungutan Madu', 'Kelompok ini mencakup usaha pemungutan hasil, pengolahan dan pemasaran madu.'),
(112, 'KLU2020-00112', '02308', 'Pemungutan Bambu', 'Kelompok ini mencakup usaha pemungutan hasil, pengolahan dan pemasaran bambu.'),
(113, 'KLU2020-00113', '02309', 'Pemungutan Bukan Kayu Lainnya', 'Kelompok ini mencakup usaha pemungutan hasil bukan kayu yang tidak dicakup dalam 02301 s.d. 02308 yang terpisah dari usaha pengusahaan hasil hutan bukan kayu, misalnya pemungutan gumpalan shellak, jernang, daun ekaliptus, kulit kayu lawang dan kayu manis, kenanga, daun/kulit/ranting cendana, kopal, pandan, purun dan lainnya.'),
(114, 'KLU2020-00114', '02401', 'Jasa Kehutanan Bidang Penggunaan Kawasan Hutan', 'Kelompok ini mencakup jasa kehutanan bidang penggunaan kawasan hutan/planologi dalam rangka penyiapan data dasar pengelolaan hutan, seperti survei pendahuluan dan survei ulang dalam rangka penilaian potensi, pengukuran dan penataan batas hutan dan penafsiran potret udara.'),
(115, 'KLU2020-00115', '02402', 'Jasa Kehutanan Bidang Perlindungan Hutan Dan Konservasi Alam', 'Kelompok ini mencakup usaha dalam rangka menunjang kegiatan perlindungan hutan dan konservasi alam, seperti jasa ANDAL/PIL (Pemantauan Informasi Lingkungan), UKL (Usaha Kelola Lingkungan), UPL (Usaha Pemantauan Lingkungan).'),
(116, 'KLU2020-00116', '02403', 'Jasa Kehutanan Bidang Rehabilitasi Lahan Dan Kehutanan Sosial', 'Kelompok ini mencakup usaha dalam rangka rrehabilitasi lahan dan kehutanan sosial baik di dalam maupun kawasan hutan.'),
(117, 'KLU2020-00117', '02409', 'Jasa Penunjang Kehutanan Lainnya', 'Kelompok ini mencakup usaha jasa di bidang kehutanan lainnya yang tidak tercakup dalam kelompok 02401 s.d. 02403, seperti kegiatan pengevaluasian kayu, pemadaman kebakaran hutan dan pengendalian hama dan jasa penebangan kayu, seperti pengangkutan kayu di dalam hutan.'),
(118, 'KLU2020-00118', '03111', 'Penangkapan Pisces/Ikan Bersirip Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan pisces atau ikan bersirip seperti ikan tuna dan cakalang (ikan big eye tuna, yellow fin tuna, albacore dan cakalang), ikan hiu (hiu macan, hiu gergaji) dan cucut (cucut tikus/cucut monyet, cucut lanyam, cucut martil/capingan dan cucut botol), ikan tenggiri,\r\nbawal, layang, lemuru, kakap merah dan ikan hias laut (ikan sekar taji layar lurik, ikan buntel pasir dan ikan kalong) di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut. Termasuk pula kegiatan kapal yang digunakan baik untuk menangkap ikan maupun pengolahan dan pengawetan ikan.'),
(119, 'KLU2020-00119', '03112', 'Penangkapan Crustacea Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan jenis udang (udang windu, udang putih, udang dogol), lobster dan crustacea laut lainnya (kepiting dan rajungan) di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut.'),
(120, 'KLU2020-00120', '03113', 'Penangkapan Mollusca Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan moluska, seperti jenis kerang mutiara, cumi-cumi, sotong, gurita dan mollusca laut lainnya (remis, simping, kerang darah, kerang hijau dan tiram) di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut.'),
(121, 'KLU2020-00121', '03114', 'Penangkapan/Pengambilan Algae (Tumbuhan) Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan tanaman air, seperti rumput laut, ganggang laut dan tanaman hias di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut.'),
(122, 'KLU2020-00122', '03115', 'Penangkapan/Pengambilan Benih Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan benih ikan seperti benih ikan bersirip, benih udang, benih kerang, benih kepiting, benih rumput laut dan benih biota lainnya di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut.'),
(123, 'KLU2020-00123', '03116', 'Penangkapan Echinodermata Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan jenis hewan laut, seperti bintang laut, teripang, bulu babi, lili laut , dan lainnya di laut, muara sungai, laguna, dan tempat lain yang dipengaruhi pasang surut.'),
(124, 'KLU2020-00124', '03117', 'Penangkapan Coelenterata Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan biota berongga dan bersel banyak, seperti anemon laut, karang laut, terumbu karang, polip, ubur­ubur, dan lainnya di laut, muara sungai, laguna, dan tempat lain yang dipengaruhi pasang surut.'),
(125, 'KLU2020-00125', '03118', 'Penangkapan Ikan Hias Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan ikan hias laut, seperti kuda laut, angel fish, clown fish, lion fish dan lainnya di laut, muara sungai, laguna, dan tempat lain yang dipengaruhi pasang surut.'),
(126, 'KLU2020-00126', '03119', 'Penangkapan Biota Air Lainnya Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan dan pengumpulan biota laut lainnya seperti mutiara alam, bunga karang, terumbu karang dan batu karang. Termasuk penangkapan paus dan pengambilan teripang, ubur-ubur, kura-kura, binatang laut (squirt laut, tunicate), bulu babi dan lain-lain.'),
(127, 'KLU2020-00127', '03121', 'Penangkapan Pisces/Ikan Bersirip Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan penangkapan pisces/ikan bersirip air tawar (ikan jelawat, betutu, belida, patin, dan lele), dan ikan hias (ikan ulang, uli dan pelangi) di perairan umum, seperti di danau, sungai, waduk, rawa dan genangan air lainnya.'),
(128, 'KLU2020-00128', '03122', 'Penangkapan Crustacea Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan crustacea air tawar, seperti udang galah, udang grago, udang putih, dan lainnya di perairan umum, seperti di danau, sungai, waduk, rawa, dan genangan air lainnya.'),
(129, 'KLU2020-00129', '03123', 'Penangkapan Mollusca Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan mollusca air tawar, seperti siput, remis, dan lainnya di perairan umum seperti di danau, sungai, waduk, rawa, dan genangan air lainnya.'),
(130, 'KLU2020-00130', '03124', 'Penangkapan/Pengambilan Algae Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan tumbuhan air, seperti ganggang, eceng gondok, lumut, dan tumbuhan hias di perairan umum seperti di danau, sungai, waduk, rawa, dan genangan air lainnya.'),
(131, 'KLU2020-00131', '03125', 'Penangkapan/Pengambilan Induk/Benih Ikan Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan pengambilan induk/benih ikan seperti induk/benih ikan bandeng, induk/benih ikan belida, induk/benih udang galah, induk/benih ikan bilih, induk/benih ikan mujair, induk/benih ikan nila, dan lainnya di perairan umum seperti di danau, sungai, waduk, rawa, dan genangan air lainnya.'),
(132, 'KLU2020-00132', '03129', 'Penangkapan Biota Air Lainnya Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan hewan atau biota air tawar seperti katak, bulus, sidat, belut, dan lainnya di perairan umum seperti di danau, sungai, waduk, rawa, dan genangan air lainnya.'),
(133, 'KLU2020-00133', '03131', 'Jasa Sarana Produksi Penangkapan Ikan Di Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana penangkapan ikan dan biota laut yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pengolahan lahan, pembuatan karamba dan jaring apung, dan sebagainya.'),
(134, 'KLU2020-00134', '03132', 'Jasa Produksi Penangkapan Ikan Di Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi penangkapan ikan dan biota laut yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa penebaran benih, jasa pemberian pakan, dan sebagainya.'),
(135, 'KLU2020-00135', '03133', 'Jasa Pasca Panen Penangkapan Ikan Di Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca psnen penangkapan ikan dan biota laut yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa persiapan lelang, jasa sortasi dan gradasi, jasa uji mutu, dan sebagainya.'),
(136, 'KLU2020-00136', '03141', 'Jasa Sarana Produksi Penangkapan Ikan Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana penangkapan dan ikan air tawar di perairan umum yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pengolahan lahan dan sebagainya.'),
(137, 'KLU2020-00137', '03142', 'Jasa Produksi Penangkapan Ikan Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi penangkapan dan ikan air tawar di perairan umum yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa perubahan benih, jasa penebaran benih, jasa pengendalian jasad pengganggu, jasa pemantauan dan sebagainya.'),
(138, 'KLU2020-00138', '03143', 'Jasa Pasca Panen Penangkapan Ikan Di Perairan Umum', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen penangkapan dan ikan air tawar di perairan umum yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa persiapan lelang, jasa sortasi dan gradasi, jasa uji mutu, jasa pengeringan, jasa pemberian es, jasa pengepakan dan penyimpanan dan sebagainya.'),
(139, 'KLU2020-00139', '03211', 'Pembesaran Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pemeliharaan dan pembesaran serta pemanenan ikan, udang, kerang mutiara, kerang darah, kerang hijau, teripang dan binatang laut lainnya (penyu, kima raksasa dan keong laut) di laut, muara sungai, laguna, tempat lain yang dipengaruhi pasang surut dan fasilitas buatan lainnya. Tidak termasuk kegiatan budidaya ikan hias air laut.'),
(140, 'KLU2020-00140', '03212', 'Pembenihan Ikan Laut', 'Kelompok ini mencakup usaha pembenihan ikan laut, udang dan biota laut lainnya (kerang mutiara, kerang hijau, penyu dan kepiting) dengan media air laut. Tidak termasuk kegiatan pembenihan ikan hias air laut.'),
(141, 'KLU2020-00141', '03213', 'Budidaya Ikan Hias Laut', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pemeliharaan dan pembesaran serta pemanenan ikan hias air laut dengan menggunakan lahan, perairan dan fasilitas buatan lainnya. Termasuk kegiatan budidaya pembenihan ikan hias air laut.'),
(142, 'KLU2020-00142', '03214', 'Budidaya Karang (Coral)', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pemeliharaan dan pembesaran serta pemanenan karang (terumbu karang) dan pemanfaatannya.'),
(143, 'KLU2020-00143', '03221', 'Pembesar Ikan Air Tawar Di Kolam', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pembesaran ikan air tawar, udang, katak dan budidaya biota air tawar lainnya (seperti buaya, labi-labi dan\r\nkura-kura) di kolam.'),
(144, 'KLU2020-00144', '03222', 'Budidaya Ikan Air Tawar Di Karamba Jaring Apung', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pembesaran ikan air tawar, udang, katak dan budidaya biota air tawar lainnya (seperti buaya, labi-labi dan\r\nkura-kura) di karamba jaring apung dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.'),
(145, 'KLU2020-00145', '03223', 'Pembesaran Ikan Air Tawar Di Karamba', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pembesaran ikan air tawar, udang, katak dan budidaya biota air tawar lainnya (seperti buaya, labi-labi dan\r\nkura-kura) di karamba dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.'),
(146, 'KLU2020-00146', '03224', 'Pembesaran Ikan Air Tawar Di Sawah', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pembesaran ikan air tawar, udang, katak dan budidaya biota air tawar lainnya (seperti buaya, labi-labi dan\r\nkura-kura) di sawah.'),
(147, 'KLU2020-00147', '03225', 'Budidaya Ikan Hias Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pembesaran ikan hias air tawar dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.'),
(148, 'KLU2020-00148', '03226', 'Pembenihan Ikan Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan pembenihan ikan air tawar (ikan mas, lele, gurame dan nila merah), ikan hias (ikan botia, uli, mas, arwana dan man fish) dan biota air tawar lainnya (udang galah, katak dan buaya) di air tawar.'),
(149, 'KLU2020-00149', '03231', 'Jasa Sarana Produksi Budidaya Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana budidaya ikan yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pengolahan lahan, pembuatan karamba dan jaring apung dan sebagainya.'),
(150, 'KLU2020-00150', '03232', 'Jasa Produksi Budidaya Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi budidaya ikan yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa penebaran benih, jasa pemberian pakan dan sebagainya.'),
(151, 'KLU2020-00151', '03233', 'Jasa Pasca Panen Budidaya Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen budidaya ikan yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa persiapan lelang, jasa sortasi dan gradasi, jasa uji mutu dan sebagainya.'),
(152, 'KLU2020-00152', '03241', 'Jasa Sarana Produksi Budidaya Ikan Di Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana budidaya ikan di air tawar yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pengolahan lahan dan sebagainya.'),
(153, 'KLU2020-00153', '03242', 'Jasa Produksi Budidaya Ikan Di Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi budidaya ikan di air tawar yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa perubahan benih, jasa pengendalian jasad pengganggu, jasa pemantauan dan sebagainya.'),
(154, 'KLU2020-00154', '03243', 'Jasa Pasca Panen Budidaya Ikan Di Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen budidaya ikan di air tawar yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa persiapan lelang, jasa sortasi dan gradasi, jasa uji mutu, jasa pengeringan, jasa pemberian es, jasa pengepakan dan penyimpanan dan sebagainya.'),
(155, 'KLU2020-00155', '03251', 'Pembesaran Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pemeliharaan dan pembesaran serta pemanenan ikan air payau (bandeng dan kakap putih), udang windu, udang putih dan biota air payau lainnya (kepiting, ketam, telapak kuda dan rumput laut) di air payau (tambak) dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.'),
(156, 'KLU2020-00156', '03252', 'Pembenihan Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan pembenihan dan pembiakan ikan air payau (ikan bandeng dan kakap putih), udang galah, udang windu dan biota lainnya (kepiting dan rumput laut) di air payau dengan menggunakan lahan, perairan dan fasiltas buatan lainnya.'),
(157, 'KLU2020-00157', '03261', 'Jasa Sarana Produksi Budidaya Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana budidaya ikan air payau yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pembuatan tambak, dan sebagainya.'),
(158, 'KLU2020-00158', '03262', 'Jasa Produksi Budidaya Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi budidaya ikan air payau yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa penebaran benih, jasa pengendalian jasad pengganggu, jasa pengendalian lingkungan dan penyakit, jasa pemberian pakan, jasa pemantauan dan sebagainya.');
INSERT INTO `tklucde` (`FRECNMB`, `FCODEZZ`, `FKLUCOD`, `FDESCRP`, `FNOTEZZ`) VALUES
(159, 'KLU2020-00159', '03263', 'Jasa Pasca Panen Budidaya Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen budidaya ikan air payau yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa sortasi dan gradasi, jasa uji pengeringan, jasa pemberian es, jasa pengepakan dan mutu, jasa penyimpanan, dan sebagainya.'),
(160, 'KLU2020-00160', '05101', 'Pertambangan Batu Bara', 'Kelompok ini mencakup usaha operasi penambangan, pengeboran berbagai kualitas batu bara seperti antrasit, bituminous dan subbitominous baik pertambangan di permukaan tanah atau bawah tanah, termasuk pertambangan dengan cara pencairan (liquefaction). Operasi pertambangan tersebut meliputi penggalian, penghancuran, pencucian, penyaringan dan pencampuran serta pemadatan meningkatkan kualitas atau memudahkan pengangkutan dan penyimpanan/penampungan. Termasuk pencarian batu bara dari kumpulan tepung bara (culm bank).'),
(161, 'KLU2020-00161', '05102', 'Gasifikasi Batu Bara Di Lokasi Penambangan', 'Kelompok ini mencakup usaha memproduksi gas dari batu bara di lokasi penambangan (on site gasification of coal).'),
(162, 'KLU2020-00162', '05200', 'Pertambangan Lignit', 'Kelompok ini mencakup usaha operasi penambangan, pengeboran berbagai kualitas lignit, seperti pertambangan lignit di permukaan tanah atau bawah tanah, termasuk pertambangan dengan cara pencairan (liquefaction). Operasi pertambangan tersebut meliputi penggalian, penghancuran, pencucian, penyaringan dan pencampuran serta pemadatan lignit untuk meningkatkan kualitas dan memudahkan pengangkutan dan penyimpanan/penampungan.'),
(163, 'KLU2020-00163', '06100', 'Pertambangan Minyak Bumi', 'Kelompok ini mencakup usaha atau kegiatan pertambangan minyak bumi mentah termasuk usaha pencarian kandungan minyak bumi, pengeboran, penambangan, pemisahan serta penampungan, produksi minyak bumi mentah kondensat, pemrosesan untuk menghasilkan minyak mentah dengan cara penampungan, penyaringan, pengeringan, stabiisasi dan lain-lain. Hasil pertambangan minyak bumi antara lain minyak mentah atau crude oil dan kondensat. Kelompok ini juga mencakup usaha operasi penambangan pasir bituminous atau oil shale (serpihan minyak) dan pasir aspal. Kegiatan pertambangan tersebut meliputi penggalian, pengeboran, penghancuran, pencucian, penyaringan dan pencampuran serta penampungan. Termasuk kegiatan produksi minyak bumi mentah dari serpihan minyak dan pasir bituminous jika terkait dengan pertambangannya. Pengolahan lanjut dari hasil minyak bumi dimasukkan dalam kelompok 19211.'),
(164, 'KLU2020-00164', '06201', 'Pertambangan Gas Alam', 'Kelompok ini mencakup usaha pencarian kandungan gas alam, pengeboran, penambangan, pemisahan serta penampungan. Hasil pertambangan gas alam antara lain gas alam. Pencairan gas alam menjadi LNG sampai kepengapalannya masih termasuk kegiatan pertambangan. Pengolahan lanjut dari hasil gas alam dimasukkan dalam kelompok 19212.'),
(165, 'KLU2020-00165', '06202', 'Pengusahaan Tenaga Panas Bumi', 'Kelompok ini mencakup usaha pencarian, pengeboran dan pengubahan tenaga panas bumi menjadi tenaga listrik. Termasuk kegiatan lain yang berhubungan dengan pengusahaan tenaga panas bumi sampai ke tempat pemanfaatannya.'),
(166, 'KLU2020-00166', '07101', 'Pertambangan Pasir Besi', 'Kelompok ini mencakup usaha penambangan pasir besi. Termasuk kegiatan pemurnian, sortasi, pemisahan dan pembersihan yang tidak dapat dipisahkan secara administratif dari usaha pertambangan pasir besi tersebut.'),
(167, 'KLU2020-00167', '07102', 'Pertambangan Bijih Besi', 'Kelompok ini mencakup usaha penambangan bijih besi termasuk kegiatan peningkatan mutu dan aglomerasi bijih besi dan pengolahan lebih lanjut bijih besi menjadi bijih logam.'),
(168, 'KLU2020-00168', '07210', 'Pertambangan Bijih Uranium Dan Thorium', 'Kelompok ini mencakup usaha penambangan bijih uranium dan thorium. Termasuk kegiatan pemurnian konsentrat uranium dan thorium dan produksi yellow cake.'),
(169, 'KLU2020-00169', '07291', 'Pertambangan Bijih Timah', 'Kelompok ini mencakup usaha penambangan dan pengolahan bijih timah. Kegiatan pembuatan dan pemurnian konsentrat menjadi logam timah (timah batangan) yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih timah, dimasukkan dalam kelompok ini.'),
(170, 'KLU2020-00170', '07292', 'Pertambangan Bijih Timah Hitam', 'Kelompok ini mencakup usaha penambangan dan pengolahan bijih timah hitam. Kegiatan pembersihan, pemisahan dan pemurnian sampai menjadi timah hitam batangan yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih timah hitam, dimasukkan dalam kelompok ini.'),
(171, 'KLU2020-00171', '07293', 'Pertambangan Bijih Bauksit', 'Kelompok ini mencakup usaha penambangan, penampungan dan pengolahan bijih bauksit. Kegiatan pemurnian konsentrat yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih bauksit, dimasukkan dalam kelompok ini.'),
(172, 'KLU2020-00172', '07294', 'Pertambangan Bijih Tembaga', 'Kelompok ini mencakup usaha penambangan dan pengolahan bijih tembaga, yang terdiri dari kalkosit serta batuan berupa campuran monticellit dan skarnyakut. Kegiatan pemurnian konsentrat yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih tembaga, dimasukkan dalam kelompok ini.'),
(173, 'KLU2020-00173', '07295', 'Pertambangan Bijih Nikel', 'Kelompok ini mencakup usaha penambangan dan pengolahan bijih nikel sampai menjadi ferro nikel. Termasuk juga usaha pemanfaatannya yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih nikel, dimasukkan dalam kelompok ini.'),
(174, 'KLU2020-00174', '07296', 'Pertambangan Bijih Mangan', 'Kelompok ini mencakup usaha penambangan, pengolahan dan pemurnian bijih mangan. Termasuk juga usaha pemanfaatannya yang tidak dapat dipisahkan dari usaha pertambangan bijih mangan, dimasukkan dalam kelompok ini.'),
(175, 'KLU2020-00175', '07299', 'Pertambangan Bahan Galian Lainnya Yang Tidak Mengandung Bijih Besi', 'Kelompok ini mencakup usaha penambangan dan pengolahan bahan galian lainnya yang tidak mengandung bijih besi yang belum termasuk kelompok 07291 s.d.\r\n07296, seperti bijih seng platinum dan silicon. Kegiatan pembersihan dan pemurnian yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih logam lainnya, dimasukkan dalam kelompok ini.'),
(176, 'KLU2020-00176', '07301', 'Pertambangan Emas Dan Perak', 'Kelompok ini mencakup usaha penambangan dan pengolahan bijih emas dan perak. Kegiatan pembersihan, pemisahan dan pemurnian sampai menjadi emas dan perak batangan yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih emas dan perak, dimasukkan dalam kelompok ini.'),
(177, 'KLU2020-00177', '07309', 'Pertambangan Bijih Logam Mulia Lainnya', 'Kelompok ini mencakup usaha penambangan dan pengolahan bijih logam mulia lainnya, selain bijih logam emas dan perak, seperti bijih platina. Kegiatan pembersihan dan pemurnian yang tidak dapat dipisahkan secara administratif dari usaha pertambangan bijih logam lainnya, dimasukkan dalam kelompok ini.'),
(178, 'KLU2020-00178', '08101', 'Penggalian Batu Hias Dan Batu Bangunan', 'Kelompok ini mencakup usaha penggalian batu hias dan batu bangunan, seperti batu pualam atau marmer, batu pasir atau paras, andesit dan granit. Kegiatan pemecahan, pembersihan, pengangkutan dan penjualan, yang tidak dapat dipisahkan secara administratif dari usaha penggalian batu hias dan bangunan, dimasukkan dalam kelompok ini.'),
(179, 'KLU2020-00179', '08102', 'Penggalian Batu Kapur/Gamping', 'Kelompok ini mencakup usaha penggalian batu batu kapur atau gamping. Kegiatan pemecahan, penghancuran, penyaringan dan penghalusan, termasuk\r\npengangkutan dan penjualan yang tidak dapat dipisahkan secara administratif dari usaha penggalian batu bahan industri, dimasukkan dalam kelompok ini.'),
(180, 'KLU2020-00180', '08103', 'Penggalian Kerikil (Sirtu)', 'Kelompok ini mencakup usaha penggalian, pembersihan dan pemisahan kerikil. Hasil dari penggalian kerikil antara lain batu pasir, bongkah keras dan pasir kerikil.'),
(181, 'KLU2020-00181', '08104', 'Penggalian Pasir', 'Kelompok ini mencakup usaha penggalian, pembersihan dan pemisahan pasir.\r\nHasil dari penggalian pasir berupa pasir beton (andesit/basalt bersih), pasir pasang (sedikit mengandung tanah), pasir uruk (banyak mengandung tanah) dan pasir kwarsa.'),
(182, 'KLU2020-00182', '08105', 'Penggalian Tanah Dan Tanah Liat', 'Kelompok ini mencakup usaha penggalian tanah dan tanah liat. Kegiatan pembentukan, penghancuran dan penggilingan yang tidak dapat dipisahkan secara administratif dari usaha penggalian tanah dan tanah liat dimasukkan dalam kelompok ini. Hasil dari penggalian tanah dan tanah liat antara lain kaolin (china clay), ball clay (firing clay), abu bumi dan serpih.'),
(183, 'KLU2020-00183', '08106', 'Penggalian Gips', 'Kelompok ini mencakup usaha penggalian gips. Kegiatan pembersihan, pemurnian dan penghalusan gips yang tidak dapat dipisahkan secara administratif dari usaha penggalian gips dimasukkan dalam kelompok ini.'),
(184, 'KLU2020-00184', '08911', 'Pertambangan Belerang', 'Kelompok ini mencakup usaha penambangan bijih belerang. Termasuk juga kegiatan penghancuran, pembersihan dan pengolahan terhadap mineral belerang yang tidak dapat dipisahkan secara administratif dari usaha pertambangan belerang tersebut. Pengolahan lanjutan dari mineral belerang yang tidak ada hubungannya dengan kegiatan atau usaha penambangan dimasukkan dalam kelompok 20114.'),
(185, 'KLU2020-00185', '08912', 'Pertambangan Fosfat', 'Kelompok ini mencakup usaha penambangan bahan galian fosfat. Kegiatan pemurnian, sortasi, penghancuran, pembersihan dan peningkatan kadar bahan galian fosfat yang tidak dapat dipisahkan secara administratif dari usaha pertambangan fosfat dimasukkan dalam kelompok ini.'),
(186, 'KLU2020-00186', '08913', 'Pertambangan Nitrat', 'Kelompok ini mencakup usaha penambangan bahan galian nitrat. Kegiatan pembersihan, pemurnian, pemecahan, sortasi dan pengolahan dengan cara lain terhadap bahan galian nitrat yang tidak dapat dipisahkan secara administratif dari usaha pertambangan nitrat dimasukkan dalam kelompok ini.'),
(187, 'KLU2020-00187', '08914', 'Pertambangan Yodium', 'Kelompok ini mencakup usaha penambangan ekstraksi air tanah yang mengandung yodium. Kegiatan distilasi dan pemurnian dari ekstraksi mineral tersebut yang tidak dapat dipisahkan secara administratif dari usaha pertambangan yodium dimasukkan dalam kelompok ini.'),
(188, 'KLU2020-00188', '08915', 'Pertambangan Potash (Kalium Karbonat)', 'Kelompok ini mencakup usaha penambangan potash dalam bentuk garam, feldpar dan leusit analeum. Kegiatan penghancuran dan pembersihan terhadap mineral tersebut yang tidak dapat dipisahkan secara administratif dari usaha pertambangan potash dimasukkan dalam kelompok ini.'),
(189, 'KLU2020-00189', '08919', 'Pertambangan Mineral, Bahan Kimia Dan Bahan Pupuk Lainnya', 'Kelompok ini mencakup usaha penambangan mineral bahan kimia dan bahan pupuk lainnya yang belum tercakup dalam kelompok 08911 s.d. 08915. Kegiatan pembersihan, pemurnian, pemisahan dan sortasi yang tidak dapat dipisahkan secara administratif dari usaha pertambangan mineral bahan kimia dan bahan pupuk lainnya dimasukkan dalam kelompok ini.'),
(190, 'KLU2020-00190', '08920', 'Ekstraksi Tanah Gambut (Peat)', 'Kelompok ini mencakup usaha operasi ekstraksi dan penggalian tanah gambut, aglomerasi tanah gambut dan pengolahan tanah gambut (peat) untuk meningkatkan kualitas atau memudahkan pengangkutan atau penyimpanan. Operasi ekstraksi tersebut meliputi penggalian, penghancuran, pencucian, penyaringan, dan pencampuran serta penampungan.'),
(191, 'KLU2020-00191', '08930', 'Ekstraksi Garam', 'Kelompok ini mencakup usaha ekstraksi garam yaitu pengambilan garam dari bawah tanah termasuk dengan pelarutan dan pemompaan, serta produksi garam dengan penguapan air laut atau air garam lainnya (air laut di tambak/empang) dan penghancuran, pemurnian dan penyulingan garam oleh petani garam. Termasuk juga kegiatan pengumpulan, pembersihan, penggilingan, penghancuran, dan pengolahan terhadap mineral garam yang tidak dapat dipisahkan secara administratif dari usaha ekstraksi tersebut.'),
(192, 'KLU2020-00192', '08991', 'Pertambangan Batu Mulia', 'Kelompok ini mencakup usaha penambangan dan penggalian batu mulia/batu permata. Termasuk kegiatan pemurnian, pemisahan/sortasi, pembersihan dan pengolahan dengan cara lain terhadap batu mulia/batu permata yang tidak dapat dipisahkan secara administratif dari usaha pertambangan dan penggalian lainnya tersebut.'),
(193, 'KLU2020-00193', '08992', 'Penggalian Batu Bahan Industri', 'Kelompok ini mencakup usaha penggalian batu bahan galian industri seperti felspar dan kalsit kwarsa. Kegiatan pemecahan, penghancuran, penyaringan dan penghalusan, termasuk pengangkutan dan penjualan yang tidak dapat dipisahkan secara administratif dari usaha penggalian batu bahan industri, dimasukkan dalam kelompok ini.'),
(194, 'KLU2020-00194', '08993', 'Pertambangan Aspal Alam', 'Kelompok ini mencakup usaha penambangan aspal alam, batu beraspal dan bitumen padat alam. Kegiatan pemurnian, pemisahan dan penuangan terhadap mineral tersebut yang tidak dapat dipisahkan secara administratif dari usaha pertambangan aspal alam dimasukkan dalam kelompok ini.'),
(195, 'KLU2020-00195', '08994', 'Penggalian Asbes', 'Kelompok ini mencakup usaha penggalian asbes dalam bentuk serabut maupun tidak. Kegiatan pembersihan dan pemisahan yang tidak dapat dipisahkan secara administratif dari usaha penggalian asbes dimasukkan dalam kelompok ini.'),
(196, 'KLU2020-00196', '08999', 'Pertambangan Dan Penggalian Lainnya Yang Tidak Dapat Diklasifikasikan Di Tempat Lain', 'Kelompok ini mencakup usaha penambangan dan penggalian bahan galian lainnya yang belum termasuk dalam golongan manapun. Termasuk kegiatan pemurnian, pemisahan/sortasi, pembersihan dan pengolahan dengan cara lain terhadap bahan tambang/galian yang tidak dapat dipisahkan secara administratif dari usaha pertambangan dan penggalian lainnya tersebut. Pertambangan dan penggalian ini antara lain mika, leusit, yaro sit, ziolet, batu penggosok, grafit alam, steatite (talc),\r\ntepung fosil siliceous dan lainnya.'),
(197, 'KLU2020-00197', '09100', 'Jasa Pertambangan Minyak Bumi Dan Gas Alam', 'Kelompok ini mencakup kegiatan jasa yang berkaitan dengan pertambangan minyak dan gas bumi yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa eksplorasi pengambilan minyak atau gas dengan cara tradisional yaitu membuat observasi geologi, pemasangan alat pengeboran, perbaikan dan pembongkaran penyemenan sumur minyak dan sumur gas, pembuatan saluran sumur, pemompaan sumur produksi, penyumbatan dan penutupan sumur produksi, pengujian produksi, dismantling, pencairan dan regasifikasi gas alam untuk kebutuhan transportasi di lokasi pertambangan, pengeboran percobaan dalam rangka penyulingan minyak bumi dan gas alam dan jasa pemadam kebakaran ladang minyak bumi dan gas alam.'),
(198, 'KLU2020-00198', '09900', 'Jasa Pertambangan Dan Penggalian Lainnya', 'Kelompok ini mencakup jasa penunjang atas dasar balas jasa atau kontrak, yang dibutuhkan dalam kegiatan pertambangan golongan pokok 05, 07, dan 08, seperti jasa eksplorasi misalnya dengan cara tradisional seperti mengambil contoh bijih\r\ndan membuat observasi geologi, jasa pemompaan dan peyaluran hasil tambang dan jasa percobaan penggalian dan pengeboran ladang atau sumur tambang.'),
(199, 'KLU2020-00199', '10110', 'Kegiatan Rumah Potong Dan Pengepakan Daging Bukan Unggas', 'Kelompok ini mencakup kegiatan operasional rumah potong hewan yang berkaitan dengan kegiatan pemotongan, pengulitan, pembersihan dan pengepakan daging, seperti daging sapi, babi, biri-biri, kelinci, domba, unta dan daging segar lainnya bukan unggas, kegiatan pengurusan hasil sampingan, seperti produksi kulit dan jangat dari tempat pemotongan hewan termasuk fellmongery, penjemuran tulang, pengolahan sisaan atau kotoran hewan, penyortiran wol dan bulu dan pembersihan lemak. Termasuk kegiatan pemotongan dan pengolahan paus di darat atau di kapal khusus. Pemotongan yang dilakukan oleh pedagang dimasukkan dalam golongan\r\n462, 472 dan 478. Kegiatan pemotongan hewan yang tidak dapat dipisahkan dari usaha peternakannya dimasukkan dalam golongan 014.'),
(200, 'KLU2020-00200', '10120', 'Kegiatan Rumah Potong Dan Pengepakan Daging Unggas', 'Kelompok ini mencakup Kegiatan operasional rumah potong unggas dan pengepakan daging unggas, termasuk kegiatan pengurusan hasil sampingan, seperti pemrosesan sisa atau kotoran unggas, pementangan kulit, penyortiran bulu dan pembersihan lemak. Pemotongan yang dilakukan oleh pedagang dimasukkan dalam golongan 462, 472 dan 478. Kegiatan pemotongan hewan yang tidak dapat dipisahkan dari usaha peternakannya dimasukkan dalam golongan 014.'),
(201, 'KLU2020-00201', '10130', 'Industri Pengolahan Dan Pengawetan Produk Daging Dan Daging Unggas', 'Kelompok ini mencakup usaha pengolahan dan pengawetan produk daging dan daging unggas dengan cara pengalengan, pengasapan, penggaraman, pembekuan, pemanisan dan sebagainya. Kegiatannya mencakup produksi daging beku dalam bentuk carcase, produksi daging beku yang telah dipotong, produksi daging beku dalam porsi tersendiri, roduksi daging yang dikeringkan, daging yang diasinkan atau daging yang diasapkan, produksi produk-produk daging, seperti sosis, salami, puding, andovillettes, saveloy, bologna, patc, rillet, daging ham, produksi kaldu dan pasta daging. Termasuk kegiatan pengolahan daging paus di darat atau di kapal khusus.'),
(202, 'KLU2020-00202', '10211', 'Industri Penggaraman/Pengeringan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/ pisces) melalui proses penggaraman/pengeringan, seperti ikan tembang asin dan ikan teri asin. Kegiatan penggaraman/pengeringan ikan yang tidak dapat dipisahkan dari usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(203, 'KLU2020-00203', '10212', 'Industri Pengasapan/Pemanggangan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pengasapan seperti ikan bandeng asap dan julung-julung asap. Kegiatan pengasapan ikan yang tidak dapat dipisahkan dari usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(204, 'KLU2020-00204', '10213', 'Industri Pembekuan Ikan', 'Kelompok ini mencakup usaha pengawetan ikan (bersirip/pisces) melalui proses pembekuan, seperti ikan bandeng beku, ikan tuna/cakalang beku dan kakap beku. Kegiatan pembekuan ikan yang tidak dapat dipisahkan dari usaha penangkaran/budidaya dimasukkan dalam golongan 031 dan 032. Kegiatan ini tidak termasuk usaha pendinginan ikan dengan es yang dimaksud untuk mempertahankan kesegaran ikan tersebut.'),
(205, 'KLU2020-00205', '10214', 'Industri Pemindangan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pemindangan, seperti pindang bandeng dan pindang tongkol. Kegiatan pemindangan ikan yang tidak dapat dipisahkan dari usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(206, 'KLU2020-00206', '10215', 'Industri Peragian/Fermentasi Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/ pisces) melalui proses peragian/ fermentasi, seperti peragian/fermentasi peda dan ikan kayu. Kegiatan peragian/fermentasi ikan yang tidak dapat dipisahkan dari usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(207, 'KLU2020-00207', '10216', 'Industri Berbasis Daging Lumatan Dan Surimi', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pelumatan daging ikan/ penggilingan. Termasuk industri daging lumat yang dicampur bahan tambahan melalui proses pemasakan atau tidak dimasak kemudian dibekukan. Contoh berbasis daging lumatan dan surimi: mata goyang, kurisi, dll. Berbasis surimi: baso, nuget, otak2, kamaboko, sosis, pempek, siomay, dimsum, chikuwa, imitation crab.'),
(208, 'KLU2020-00208', '10217', 'Industri Pendinginan/Pengesan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/ pisces) melalui proses pendinginan/pengesan. Kegiatan pendinginan/pengesan ikan yang tidak dapat dipisahkan dari usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(209, 'KLU2020-00209', '10219', 'Industri Pengolahan Dan Pengawetan Lainnya Untuk Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces)\r\ndengan cara selain yang tercakup dalam kelompok 10211 s.d. 10217'),
(210, 'KLU2020-00210', '10221', 'Industri Pengolahan Dan Pengawetan Ikan Dan Biota Air (Bukan Udang) Dalam Kaleng', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan dan biota perairan lainnya kecuali udang melalui proses pengalengan, seperti ikan sardencis dalam kaleng dan kerang dalam kaleng. Kegiatan kapal pengolah ikan yang hanya melakukan pengolahan dan pengawetan dalam kaleng (tanpa melakukan kegiatan penangkapan) termasuk dalam kelompok ini.'),
(211, 'KLU2020-00211', '10222', 'Industri Pengolahan Dan Pengawetan Udang Dalam Kaleng', 'Kelompok ini mencakup usaha pengolahan dan pengawetan udang melalui proses pengalengan (udang dalam kaleng). Kegiatan kapal pengolah udang yang hanya melakukan pengolahan dan pengawetan dalam kaleng (tanpa melakukan kegiatan penangkapan) termasuk dalam kelompok ini.'),
(212, 'KLU2020-00212', '10291', 'Industri Penggaraman/Pengeringan Biota Air Lainnya', 'Kelompok mi mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses penggaraman/pengeringan, seperti udang asin dan cumi-cumi asin. Kegiatan penggaraman/pengeringan crustacea, mollusca dan biota perairan lainnya yang tidak dapat dipisahkan dan usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(213, 'KLU2020-00213', '10292', 'Industri Pengasapan/Pemanggangan Biota Air Lainnya', 'Kelompok mi mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses pengasapan. Kegiatan pengasapan crustacea, mollusca dan biota perairan lainnya yang tidak dapat dipisahkan dan usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(214, 'KLU2020-00214', '10293', 'Industri Pembekuan Biota Air Lainnya', 'Kelompok mi mencakup usaha pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses pembekuan, seperti udang beku dan paha kodok beku. Kegiatan pembekuan crustacea, mollusca dan biota perairan lainnya yang tidak dapat dipisahkan dan usaha penangkaran/budidaya dimasukkan dalam golongan\r\n031 dan 032. Kegiatan mi tidak termasuk usaha pendinginan crustacea, mollusca dan biota air lainnya dengan es yang dimaksud untuk mempertahankan kesegarannya.'),
(215, 'KLU2020-00215', '10294', 'Industri Pemindangan Biota Air Lainnya', 'Kelompok mi mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses pemindangan. Kegiatan pemindangan crustacea, mollusca dan biota perairan lainnya yang tidak dapat dipisahkan dan usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(216, 'KLU2020-00216', '10295', 'Industri Peragian/Fermentasi Biota Air Lainnya', 'Kelompok mi mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses peragian/fermentasi. Kegiatan peragian/ fermentasi crustacea, mollusca dan biota perairan lainnya yang tidak dapat dipisahkan dan usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(217, 'KLU2020-00217', '10296', 'Industri Berbasis Lumatan Biota Air Lainnya', 'Kelompok mi mencakup usaha pengolahan dan pengawetan biota air lainnya melalui proses pelumatan daging/penggiingan/pencampuran bahan tambahan/pengukusan, seperti lumatan cumi, lumatan udang, baso udang, baso cumi, baso kepiting, dan kaki naga udang.'),
(218, 'KLU2020-00218', '10297', 'Industri Pendinginan/Pengesan Biota Air Lainnya', 'Kelompok mi mencakup usaha pengolahan dan pengawetan cnustacea, mollusca dan biota perairan lainnya melalui proses pendinginan/pengesan, seperti cumi segar, kerang segar, tenipang segar, dan kepiting segar. Kegiatan pendinginan/pengesan cnustacea, mollusca dan biota perairan lainnya yang tidak dapat dipisahkan dan usaha penangkapan/budidaya dimasukkan dalam golongan\r\n031 dan 032.'),
(219, 'KLU2020-00219', '10299', 'Industri Pengolahan Dan Pengawetan Lainnya Untuk Biota Air Lainnya', 'Kelompok mi mencakup usaha pengolahan dan pengawetan cnustacea, mollusca dan biota perairan lainnya dengan cara selain yang tercakup dalam kelompok\r\n10291 s.d. 10294, seperti tepung udang, tepung kerang. Kegiatan pengolahan dan pengawetan lainnya untuk cnustacea, mollusca dan biota perairan lainnya yang tidak dapat dipisahkan dari usaha penangkapan/budidaya dimasukkan dalam golongan 031 dan 032.'),
(220, 'KLU2020-00220', '10311', 'Industri Pengasinan/Pemanisan Buah-Buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pengasinan/pemanisan, baik dalam bentuk kemasan ataupun tidak, seperti asinan kedondong, asinan wortel, manisan pala dan manisan mangga.'),
(221, 'KLU2020-00221', '10312', 'Industri Pelumatan Buah-Buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pelumatan, baik dalam bentuk kemasan ataupun tidak, seperti selai mangga, jelly murbai, sauce tomat, cabe giling dan sauce selada.'),
(222, 'KLU2020-00222', '10313', 'Industri Pengeringan Buah-Buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan cara pengeringan, baik dalam bentuk kemasan ataupun tidak, seperti kismis (anggur), bawang merah, bawang putih, cabe kering, rebung kering dan jamur kering.'),
(223, 'KLU2020-00223', '10314', 'Industri Pembekuan Buah-Buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pembekuan, seperti buah-buahan beku dan sayur-sayuran beku.'),
(224, 'KLU2020-00224', '10320', 'Industri Pengolahan Dan Pengawetan Buah-Buahan Dan Sayuran Dalam Kaleng', 'Kelompok ini mencakup usaha pengolahan dan pengawetan buah­buahan dan sayuran melalui proses pengalengan, seperti nanas dalam kaleng, rambutan dalam kaleng, kacang dalam kaleng dan wortel dalam kaleng. Yang dimaksud pengalengan di sini merupakan proses pengawetan dan bukan hanya pengemasan.'),
(225, 'KLU2020-00225', '10330', 'Industri Pengolahan Sari Buah Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan cara pengolahan sari buah-buahan dan sayuran, seperti bubuk sari buah-buahan, air/sari pekat buah buahan dan air/sari pekat sayuran.'),
(226, 'KLU2020-00226', '10391', 'Industri Tempe Kedelai', 'Kelompok ini mencakup usaha pembuatan tempe dari kedelai. Usaha pembuatan tempe yang bahan bakunya selain kedelai, seperti tempe bongkrek, dimasukkan dalam kelompok 10399.'),
(227, 'KLU2020-00227', '10392', 'Industri Tahu Kedelai', 'Kelompok ini mencakup usaha pembuatan tahu dari kedelai.'),
(228, 'KLU2020-00228', '10399', 'Industri Pengolahan Dan Pengawetan Lainnya Buah­Buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan cara selain yang tercakup dalam subgolongan 1031 s.d. 1033, seperti industri pengupasan kentang dan produksi konsentrat dari buah dan sayuran segar.'),
(229, 'KLU2020-00229', '10411', 'Industri Minyak Makan Dan Lemak Nabati', 'Kelompok ini mencakup usaha pengolahan bahan-bahan dari nabati menjadi minyak mentah (crude oil) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain kecuali minyak mentah kelapa sawit (crude plam oil) dan mimyak mentah kelapa, termasuk juga industri hasil lemak dari nabati yang dapat digunakan sebagai bahan makanan, seperti minyak bunga matahari. Kegiatan pengolahan minyak makan yang tidak dapat dipisahkan dari usaha pertaniannya dimasukkan golongan 011, 012 dan 014.'),
(230, 'KLU2020-00230', '10412', 'Industri Margarine', 'Kelompok ini mencakup usaha pembuatan margarine dari minyak makan nabati.'),
(231, 'KLU2020-00231', '10413', 'Industri Minyak Makan Dan Lemak Hewani Selain Ikan', 'Kelompok ini mencakup usaha pengolahan bahan-bahan dari hewani selain ikan menjadi minyak makan dan lemak hewani, seperti minyak/lemak babi, lemak sapi dan lemak unggas.'),
(232, 'KLU2020-00232', '10414', 'Industri Minyak Ikan', 'Kelompok ini mencakup usaha pembuatan minyak yang berbahan baku dari badan ikan yang berlemak tinggi, seperti lemuru, atau dari organ badan ikan seperti hati cucut. Mencakup juga industri minyak yang dihasilkan dari hasil sampingan pengalengan ikan, seperti hasil pengalengan sarden. Pengolahan minyak ikan/biota perairan lainnya yang digunakan untuk bahan farmasi ataupun kosmetik dimasukkan dalam subgolongan 2101 dan 2102.'),
(233, 'KLU2020-00233', '10415', 'Industri Minyak Goreng Bukan Minyak Kelapa Dan Minyak Kelapa Sawit', 'Kelompok ini mencakup usaha pembuatan minyak goreng lainnya, bukan minyak goreng kelapa dan mimyak goreng kelapa sawit, seperti minyak bekatul, minyak goreng babi dan minyak goreng unggas.'),
(234, 'KLU2020-00234', '10421', 'Industri Kopra', 'Kelompok ini mencakup usaha pembuatan kopra yang terpisah dari usaha pertaniannya. Kegiatan pembuatan kopra yang tidak dapat dipisahkan dari usaha pertaniannya dimasukkan dalam kelompok 01261.'),
(235, 'KLU2020-00235', '10422', 'Industri Minyak Makan Kelapa', 'Kelompok ini mencakup usaha pengolahan kelapa menjadi minyak mentah atau minyak makan (crude oil) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain. Kegiatan pengolahan minyak makan kelapa yang\r\ntidak dapat dipisahkan dari usaha pertaniannya dimasukkan golongan 011, 012 dan 014.'),
(236, 'KLU2020-00236', '10423', 'Industri Minyak Goreng Kelapa', 'Kelompok ini mencakup usaha pengolahan lebih lanjut (pemurnian, pemucatan\r\ndan penghilangan bau yang tidak dikehendaki) dari minyak mentah kelapa menjadi minyak goreng kelapa.'),
(237, 'KLU2020-00237', '10424', 'Industri Tepung Dan Pelet Kelapa', 'Kelompok ini mencakup usaha pengolahan lebih lanjut kelapa, seperti tepung dan pelet kelapa.'),
(238, 'KLU2020-00238', '10431', 'Industri Minyak Makan Kelapan Sawit (Criude Palm Oil)', 'Kelompok ini mencakup usaha pengolahan kelapa sawit menjadi minyak mentah (crude palm oil) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain. Kegiatan pengolahan minyak makan yang tidak dapat dipisahkan dari usaha pertaniannya dimasukkan golongan 011, 012 dan 014.'),
(239, 'KLU2020-00239', '10432', 'Industri Minyak Goreng Kelapa Sawit', 'Kelompok ini mencakup usaha pengolahan lebih lanjut (pemurnian, pemucatan dan penghilangan bau yang tidak dikehendaki) dari minyak mentah kelapa sawit (CPO) menjadi minyak goreng kelapa sawit.'),
(240, 'KLU2020-00240', '10490', 'Industri Minyak Makan Dan Lemak Nabati Dan Hewani Lainnya', 'Kelompok ini mencakup usaha pengolahan lainnya untuk minyak makan dan lemak, yang belum tercakup pada subgolongan 1041 s.d. 1043, seperti industri shorterning (minyak roti), industri minyak dan lemak dari binatang yang tidak dapat dimakan, produksi (linter) sisaan kapas, bungkil atau ampas dan hasil sisaan lainnya dari produksi minyak dan penyulingan minyak dari ikan dan mamalia laut.'),
(241, 'KLU2020-00241', '10510', 'Industri Pengolahan Susu Segar Dan Krim', 'Kelompok ini mencakup usaha Iidustri pengolahan susu cair segar, susu dipasteurisasi, disterilisasi, homogenisasi dan atau pemanasan ultra (UHT) dan industri pengolahan krim dari susu cair segar, pasteurisasi, sterilisasi dan homogenisasi. Kegiatan pasteurisasi susu yang tidak dapat dipisahkan dari usaha peternakannya dimasukkan dalam golongan 014.'),
(242, 'KLU2020-00242', '10520', 'Industri Pengolahan Susu Bubuk Dan Susu Kental', 'Kelompok ini mencakup usaha industri pengolahan susu bubuk atau susu kental dengan pemanis atau tidak dan industri pengolahan susu atau krim dalam bentuk yang padat.'),
(243, 'KLU2020-00243', '10531', 'Industri Pengolahan Es Krim', 'Kelompok ini mencakup usaha pembuatan berbagai macam es krim yang bahan utamanya dari susu. Pembuatan es krim yang bahan utamanya bukan dari susu dimasukkan dalam kelompok 10532.'),
(244, 'KLU2020-00244', '10532', 'Industri Pengolahan Es Sejenisnya Yang Dapat Dimakan (Bukan Es Batu Dan Es Balok)', 'Kelompok ini mencakup usaha pembuatan berbagai macam es yang bahan utamanya bukan dari susu, seperti sorbet, es lilin, ice drop, es dengan berbagai rasa lainnya, es mambo dan es puter. Usaha es kering (dry ice) dimasukkan dalam kelompok 20112.'),
(245, 'KLU2020-00245', '10590', 'Industri Pengolahan Produk Dari Susu Lainnya', 'Kelompok ini mencakup usaha pengolahan produk dari susu lainnya, seperti mentega, yoghurt, keju dan dadih, air dadih, kasein atau laktosa (susu manis) dan bubuk es krim. Pembuatan es krim yang bahan utamanya dari susu dimasukkan dalam kelompok 10531.'),
(246, 'KLU2020-00246', '10611', 'Industri Penggilingan Dan Pembersihan Padi-Padian Dan Biji-Bijian', 'Kelompok mi mencakup usaha penggiingan dan pembersihan padi­padian lainnya, seperti gandum dan sorghum. Kegiatan penggilingan dan pembersihan yang tidak dapat dipisahkan dan usaha pertaniannya dimasukkan dalam kelompok yang bersesuaian pada subgolongan 0111.'),
(247, 'KLU2020-00247', '10612', 'Industri Pengupasan, Pembersihan Dan Sortasi Kopi', 'Kelompok mi mencakup usaha pengupasan, pembersihan dan sortasi kopi yang terpisah dan usaha pertaniannya. Kegiatan pengupasan, pembersihan dan sortasi kopi yang tidak dapat dipisahkan dan usaha pertaniannya dimasukkan dalam kelompok 01270. Pembuatan bubuk kopi dimasukkan dalam kelompok 10761.'),
(248, 'KLU2020-00248', '10613', 'Industri Pengupasan, Pembersihan Dan Pengeringan', 'Kelompok mi mencakup usaha pengupasan dan pembersihan kakao yang terpisah dan usaha pertaniannya. Kegiatan pengupasan dan pembersihan kakao yang tidak dapat dipisahkan dan usaha pertaniannya dimasukkan dalam kelompok 01270.'),
(249, 'KLU2020-00249', '10614', 'Industri Pengupasan Dan Pembersihan Biji-Bijian Bukan Kopi Dan Kakao', 'Kelompok mi mencakup usaha pengupasan dan pembersihan biji­bijian bukan kopi dan kakao yang tenpisah dan usaha pertaniannya, seperti buah pala, lada, biji mete, kemini dan panili. Kegiatan pengupasan dan pembersihan biji-bijian selain kopi dan kakao yang tidak dapat dipisahkan dan usaha pertaniannya dimasukkan dalam subgolongan 0125 dan 0128.'),
(250, 'KLU2020-00250', '10615', 'Industri Pengupasan Dan Pembersihan Kacang-Kacangan', 'Kelompok mi mencakup usaha pengupasan dan pembersihan kacang-kacangan yang tenpisah dan usaha pertaniannya, seperti kacang tanah, kacang hijau, kacang kedele dan kacang merah. Kegiatan pengupasan dan pembersihan kacang- kacangan yang tidak dapat dipisahkan dan usaha pertaniannya dimasukkan dalam subgolongan 0111 dan 0113.');
